import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBIcon,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import CardExample from './event1';

class Testimonials extends React.Component {
    render() {
        return(

            <div>
            
     
            <MDBContainer>
            <h2>Testimonials</h2>
            <br/><br/>
                <MDBRow>
                <MDBIcon className="fa fa-quote-left pr-2" />  
                 <p md="6" lg="6" sm="12">Lorem ipsum dolor sit amet consectetur adipisicing elit. Repellendus, numquam atque vero dicta quod cum, ipsam veniam praesentium explicabo odit qui iusto voluptas perferendis! Itaque consequatur facilis dignissimos nulla veritatis.</p>
                </MDBRow>
                <br/><br/>
            </MDBContainer>
            </div>
        );
    }
}

export default Testimonials;
